# part 1

def react(input)
  arr = input.dup
  start_count = arr.size
  end_count = 0

  until start_count == end_count
    start_count = arr.size
    i = start_count - 1
    while i > 0
      if arr[i] != arr[i - 1] && arr[i].downcase == arr[i - 1].downcase
        2.times { arr.slice!(i - 1) }
        i -= 1
      end
      i -= 1
    end
    end_count = arr.size
  end
  arr.size
end

input = DATA.read.split('')
puts react(input)

# part 2

DATA.rewind
input = DATA.read

('a'..'z').each do |a|
  cleaned = input.dup.gsub(a, '').gsub(a.upcase, '')
  count = react(cleaned.split(''))
  puts [a, count, '-'].to_s
end

